import Cash from "../components/Cash";

function Test() {
  return (
    <div
      style={{
        backgroundColor: "grey",
        height: "100vh",
        display: "flex",
        gap: "200px",
      }}
    >
      <Cash />
    </div>
  );
}

export default Test;
